import React, { Component } from 'react';
import Auxiliary from './../../hoc/Auxiliary';

class RespaldoBuilder extends Component {
    
    render() { 
        return ( 
            <Auxiliary>
                <div>Titulo de Etapa</div>
                <div>Respaldo</div>
                <div>Opciones de Respaldo</div>
            </Auxiliary>
         );
    }
}
 
export default RespaldoBuilder;
